import React from 'react';
import './MatchCard.css';

function MatchCard(res) {

  return (
    <div>
      <div className="card">
        <div className="container">
          <h4><b>Name/s: {res.name}</b></h4>
          <p>Team name: {res.team.name}</p> 
        </div>
      </div>
    </div>
  );
}

export default MatchCard;
